import unittest


# https://leetcode.com/problems/minimum-window-substring

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        min_substring = ""
        character_count = {}

        if len(t) > len(s):
            return min_substring

        for i in range(len(t)):
            character_count[t[i]] = character_count.get(t[i], 0) + 1

        start, last_index = 0, len(s) - len(t) + 1

        while start < last_index:
            char_count = character_count.copy()
            last_sub_index = len(s)
            if len(min_substring) > 0:
                last_sub_index = min(len(s), start + len(min_substring) + 1)

            for end in range(start, last_sub_index):
                if s[end] in char_count:
                    char_count[s[end]] -= 1
                    if char_count[s[end]] == 0:
                        del char_count[s[end]]
                elif start == end:
                    break

                if len(char_count) == 0:
                    if len(min_substring) == 0 or len(s[start:end + 1]) < len(min_substring):
                        min_substring = s[start:end + 1]
                    break

            start += 1

        return min_substring


class TestStringMethods(unittest.TestCase):
    def test_a(self):
        self.assertEqual("BANC", Solution().minWindow("ADOBECODEBANC", "ABC"))

    def test_b(self):
        self.assertEqual("a", Solution().minWindow("a", "a"))

    def test_c(self):
        self.assertEqual("a", Solution().minWindow(
            "",
            ""))


if __name__ == "__main__":
    unittest.main()
